document.addEventListener("DOMContentLoaded",function(){const e=document.querySelector('meta[name="food-menu"]'),n=!!e&&"true"===e.getAttribute("enabled");if(n){const e=document.getElementById("foodMenuContainer");if(e){e.innerHTML='\n                <div data-squarehero="restaurant-menu">\n                    <div class="menu-tabs" id="menuTabs"></div>\n                    <div class="view-menu-button">\n                        <button onclick="window.location.href=\'/menu\'">View Our Menu</button>\n                    </div>\n                </div>\n            ';const n=document.querySelector('meta[name="food-menu-sheet"]');if(!n)return void console.error("Meta tag for Google Sheets URL not found");const o=n.getAttribute("content");Papa.parse(o,{download:!0,header:!0,complete:function(e){const n=e.data,o=document.getElementById("menuTabs"),t=[...new Set(n.map(e=>e.Menu))];t.forEach(e=>{const n=document.createElement("button");n.textContent=e,n.onclick=function(){window.location.href="/menu"},o.appendChild(n)})},error:function(e,n){console.error("Error parsing CSV:",e,n)}})}else console.error("foodMenuContainer not found")}else console.log("Food menu is not enabled")});